import React, { useState } from 'react';

import './calendar.css';
import './App.css';


function Content(){
return (
   <div id='content'>
      <img src='/img/usuario50.jpg'/>
      LOGIN
   </div>
  )
}

function Content2(){
  return (
     <div>
        <img src='/img/usuario50.jpg'/>
        ADMINISTRADOR
     </div>
    )
  }

  function Content3(){
    return (
       <div>
          <img src='/img/usuario50.jpg'/>
          Huella
       </div>
      )
    }

    function Date(){
      return (

               <input type="date" className='date'></input>
        )
      }

    function Seleccionar(){
      <select>
        <option value="grapefruit">Grapefruit</option>
        <option value="lime">Lime</option>
        <option selected value="coconut">Coconut</option>
        <option value="mango">Mango</option>
     </select>
    }

function App() {
  const [value, onChange] = useState(new Date());
  return (   
      <div>

        <header>
         <Content />
        <Date />
        </header>
          <Content2 />
          <Content3 />



      </div>
  );
}

export default App;
